import styled from 'styled-components'

export const Section = styled.div`
  margin-top: 16px;
  width: 100%;
  word-wrap: break-word;
  background: read-only;

  .single-tile {
    display: flex;
    flex-direction: column;
    margin-bottom: 8px;
    border: 1px solid black;
    padding: 4px;
    width: 200px;

    p {
      color: black;
      font-size: 18px;
      text-align: left;
      margin: 4px 0;
    }

    button {
      background: transparent;
      border: none;
      margin: 0;
      padding: 0;
      text-align: left;
      cursor: pointer;

      p {
        text-decoration: underline;
        color: blue;
      }
    }
  }
`
